import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink
} from 'react-router-dom';
import './App.css';

const s = {color: 'grey', textDecoration: 'none', cursor: 'default'}

function App() {
  return(
    <div>
      <NavLink exact to="/" style={{margin: '5px'}} activeStyle={s}>HOME</NavLink>
      <NavLink to="/about" style={{margin: '5px'}} activeStyle={s}>ABOUT</NavLink>
      <NavLink to="/users" style={{margin: '5px'}} activeStyle={s}>USERS</NavLink>
      <div style={{fontSize: '3em', margin: '25px'}}>
        <Switch>
          <Route exact path="/" component={Home}></Route>
          <Route exact path="/about" component={About}></Route>
          <Route exact path="/users/:name" component={Users}></Route>
          <Route path="/" component={PageNotFound}></Route>
        </Switch>
      </div>
    </div>
  );  
}

function Home() {
  return(
    <h2>Welcome to this page</h2>
  )
}

function About() {
  return(
    <h2>About</h2>
  )
}

function Users() {
  return(
    <h2>Users</h2>
  )
}

function PageNotFound() {
  return(
    <h2>404 Page Not Found</h2>
  )
}

export default App;
